import React from 'react';


function Card(props) {
    const { jsonArrayName, jsonData } = props;

    return (
        <div className="card-list">
            {jsonData[jsonArrayName].map((card, index) => (
                <Card
                    key={index}
                    imageUrl={card.image}
                    title={card.title}
                    description={card.description}
                />
            ))}
        </div>
    );
}

export default Card;
